/* CRIAÇÃO DAS TABELAS DO BANCO - lembrar de ao final do projeto adicionar NOT NULL para algum dos atributos*/
/* VERIFICAR NAS TABELAS RELACIONADAS A ESTOQUE/QUANTIDADE/ENDEREÇO SE SERÁ UTILIZADO NUMERIC OU INTEGER*/

create table tblEstado (
    cod_estado integer primary key identity not null,
    nome_estado  varchar (50) not null,
    sigla_estado char (2) not null,
    regiao_estado int not null,
);
go

create table  tblMunicipio (
  cod_municipio integer primary key not null,
  nome_municipio varchar (255) not null,
  cod_estado integer not null,
);
	alter table tblMunicipio
		add constraint fk_codEstadoMunicipio foreign key (cod_estado) references tblEstado(cod_estado);
go

create table tblTipo_Usuario (
cod_tipo integer primary key identity not null,
nome_tipo varchar(50),
)
go

create table tblFuncionario (
	cod_func integer primary key identity not null,
	nomeLogin_func varchar (50),
	senha_func varchar(20),
	nome_func varchar(50),
	cpf_func varchar(11),
	email_func varchar(50),
	celular_func varchar(14),
	adm_func bit,
	cargo_func varchar(50),
	status_func varchar(7),
	endereco_func varchar(50),
	numEnd_func varchar(20),
	complemento_func varchar(20),
	bairro_func varchar(50),
	cod_municipio integer,
	cod_estado integer,
	cep_func varchar(10),
	dtCad_func datetime not null default getdate()
) 
	alter table tblFuncionario
		add constraint fk_codCidadeFunc foreign key (cod_municipio) references tblMunicipio(cod_municipio);
	alter table tblFuncionario
		add constraint fk_codEstadoFunc foreign key (cod_estado) references tblEstado(cod_estado);
 
go
 
create table tblPlanta (
	cod_planta integer primary key identity not null,
	cod_func integer not null,
	nome_planta varchar(50),
	nomeCient_planta varchar(50),
	desc_planta text,
	foto_planta image,
	dtCad_planta datetime not null default getdate()
)
	alter table tblPlanta
		add constraint fk_codFuncionarioPlanta foreign key (cod_func) references tblFuncionario(cod_func);
go 

create table tblDoenca (
	cod_doenca integer primary key identity not null,
	cod_func integer not null,
	nome_doenca varchar(50),
	nomeCient_doenca varchar(50),
	desc_doenca text,
	foto_doenca image,
	dtCad_doenca datetime not null default getdate()
)
	alter table tblDoenca
		add constraint fk_codFuncionarioDoenca foreign key (cod_func) references tblFuncionario(cod_func);
go 

create table tblFaq(
	cod_faq integer not null primary key identity,
	cod_func integer not null,
	status_faq varchar(7),
	pergunta_faq varchar(100),
	resposta_faq  text,
	dtCad_faq datetime not null default getdate()
)
	alter table tblFaq
		add constraint fk_codFuncionarioFaq foreign key (cod_func) references tblFuncionario(cod_func);
go

create table tblCliente (
	cod_cli integer primary key identity not null,
	nomeLogin_cli varchar (50) not null,
	senha_cli varchar(20) not null,
	nome_cli varchar(50),
	cpf_cli varchar(11),
	email_cli varchar(50) not null,
	celular_cli varchar(14),
	status_cli varchar(7),
	endereco_cli varchar(50),
	numEnd_cli varchar(20),
	complemento_cli varchar(20),
	bairro_cli varchar(50),
	cidade_cli int,
	estado_cli int,
	cep_cli varchar(10),
	termoSeg_cli varchar(3),
	dtCad_cli datetime not null default getdate(),
	cod_tipo_cli int default 3
)
	alter table tblCliente
		add constraint fk_codCidade foreign key (cidade_cli) references tblMunicipio(cod_municipio);
	alter table tblCliente
		add constraint fk_codEstado foreign key (estado_cli) references tblEstado(cod_estado);
go 

create table tblColecao (
	cod_plantaCliente integer primary key identity not null,
	nome_plantaCliente varchar(50) not null,
	cod_usu integer not null,
	desc_plantaCliente text,
)
go

create table tblPedido (
	cod_ped integer primary key identity not null,
	cod_cli integer not null,
	status_ped varchar(20),
	dtCad_ped datetime not null default getdate()
)
	alter table tblPedido
		add constraint fk_codClientePedido foreign key (cod_cli) references tblCliente(cod_cli);
go 


create table tblProduto (
	cod_prod integer primary key identity not null,
	nome_prod varchar(50),
	precoCusto_prod decimal(10,2),
	precoVenda_prod decimal(10,2),
	desc_prod text,
	estoq_prod integer,
	foto_prod image,
	status_prod varchar(12),
	dtCad_prod datetime not null default getdate()
)
go


create table tblPedido_Produto (
	cod_ped_prod integer primary key identity not null,
	cod_ped integer not null,
	cod_prod integer not null,
	qtd_prod integer,
	precoItem_ped decimal(10,2)
)
	alter table tblPedido_Produto
		add constraint fk_codPedidoPedProd foreign key (cod_ped) references tblPedido(cod_ped);
	alter table tblPedido_Produto
		add constraint fk_codProdutoPedProd foreign key (cod_prod) references tblProduto(cod_prod);
go


/* CRIAÇÃO DA PROCEDURE DE RECONHECIMENTO DE LOGIN */

create procedure autenticar 
@nomeLogin_cli varchar(50),
@senha_cli varchar(20)
as
begin
	select cod_cli, nomeLogin_cli, senha_cli, (0) as tipo from tblCliente where nomeLogin_cli=@nomeLogin_cli and senha_cli=@senha_cli;
end

